    return (
        <Container>
            <Row>
                <div className='cart-title mt-4'>عربة التسوق </div>
            </Row>
            <Row className='d-flex justify-content-center'>
            <Col xs="12" md="9" >
                <CartItem />
                <CartItem />
                <CartItem />
        
            </Col>
            <Col xs="6" md="3"></Col>
            </Row>
        </Container>
    );
};

export default CartPage;
